import React from 'react'
import { Link } from 'react-router-dom';

export default function Nav() {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><a href="/about">About</a></li>
      </ul>
    </nav>
  )
}
